import React, {Component } from 'react';
import './App.css';

class Cadastro extends Component {
    constructor(props){
        super(props)
        this.state = {
            user : { id: '', nome: '', cnpj: '', insc: '', latitude: '', longitude:'',},
        }
    }
    updateValue = (e) => {
        const user = { ...this.state.user };
        user[e.target.name] = e.target.value;
        this.setState({ user });
    }
    render() {
        return (
            <div>
                <div className="centralizar">
                    <h2>Cadastro</h2>
                    <form >
                        <div className="row">
                            <div className="form-group col-sm-12" >
                                Nome
              <input required type="text" className="form-control" pattern="[a-zA-Z ' ']+" name="nome" value={this.state.user.nome} onChange={(e) => this.updateValue(e)} />
                            </div>
                            <div className="form-group col-sm-12">
                                CNPJ
              <input type="text" className="form-control" placeholder="99.999.999/9999-99" required name="cnpj" />
                            </div>
                            <div className="form-group col-sm-12">
                                Inscrição Estadual
              <input type="text" className="form-control" placeholder="999.999.999" required name="inscricao" />
                            </div>
                            <div className="form-group col-sm-6">
                                Latitude
              <input type="number" className="form-control" placeholder="99.99999999" required
                                    name="latitude" />
                            </div>
                            <div className="form-group col-sm-6">
                                Longitude
              <input type="number" className="form-control" placeholder="99.99999999" required
                                    name="longitude" />
                            </div>
                        </div>

                    </form>
                    <button className="btn btn-dark" onClick={() => this.props.addUser("oi")}>Salvar</button>
                    <button className="btn btn-dark" onClick={() => this.state.user.nome}>Salvar</button>
                </div >
            </div >
        );
    }
}
export default (Cadastro);
